<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <style>
        html,
        body {
            height: 100%;
        }

        body {
            margin: 0;
            overflow: hidden;
            background: rgba(238.85620191259295, 238.85620191259295, 238.85620191259295, 1);
            /* disables highlighting on mobile */
            -webkit-user-select: none;
            -moz-user-select: none;
            user-select: none;
            -webkit-touch-callout: none;
        }

        canvas {
            outline: none;
            display: block;
        }

        #blurhash {
            width: 100%;
            height: 100%;
            position: absolute;
            top: 0;
            left: 0;
            z-index: 2;
        }

        #preloader {
            position: absolute;
            display: flex;
            top: 0;
            left: 0;
            align-items: center;
            justify-content: center;
            width: 100%;
            height: 100%;
            z-index: 3;
        }

        @keyframes spin {
            0% {
                transform: rotate(0deg);
            }
            100% {
                transform: rotate(360deg);
            }
        }

        #spinner {
            color: rgba(0, 0, 0, 0.5);
            animation: spin 1s infinite linear;
        }

        .spline-watermark {
            position: absolute;
            z-index: 4;
            bottom: 20px;
            right: 20px;
            width: 137px;
            height: 36px;
            display: flex;
            flex-direction: row;
            align-items: center;
            justify-content: center;
            gap: 6px;
            border-radius: 12px;
            background: linear-gradient(180deg, #16181C 0%, #121316 100%);
            box-shadow: inset 0px -2px 0px -1px #060709, inset 0px 1px 0px rgba(255, 255, 255, 0.04);
        }

        .spline-watermark span {
            display: block;
            width: 20px;
            height: 20px;
            background-image: url(https://app.spline.design/_assets/_icons/icon_favicon32x32.png);
            background-size: cover;
        }

        .spline-watermark svg {
            display: block;
            margin-right: 2px;
        }

        .spline-watermark:hover {
            background: linear-gradient(180deg, #1B1C21 0%, #17181C 100%);
        }
    </style>
